  var css = document.createElement('style');
  css.innerHTML = `@import url(https://fonts.googleapis.com/css?family=Rubik:400,500&display=swap);.fade-enter-active[data-v-53b1fe5e],.fade-leave-active[data-v-53b1fe5e]{transition:opacity .5s}.fade-enter[data-v-53b1fe5e],.fade-leave-to[data-v-53b1fe5e]{opacity:0}`;
